import React from "react";

const Education = () => {
  return (
    <section id="education">
      <h2>Education</h2>
      <ul>
        <li>
          <strong>School:</strong> Kendriya Vidyalaya Tuli
        </li>
        <li>
          <strong>College:</strong> Assam Downtown University
        </li>
      </ul>
    </section>
  );
};

export default Education;
